Hmm.. this is strange. I can't reproduce being able to stop the debug process when the "Starting DevTools..." popup is shown. Can you post a screen capture of this, or a screenshot indicating what buttons you're using? I'd like to see if you're using something different than what I'm thinking of.

And then the "Activating DevTools" message is shown in the debug console after your app has started?

@kenzieschmoll for this version of flutter we're using the daemon method `devtools.serve` to start DevTools, so it looks like we should be going through the code you linked. Not sure why there would be multiple pub activations in this case.

@helin24 sorry for the late...if the Devtool doesn't get installed, it will time out, every time, and the pub process would get stacked up. But once you have killed these processes, **and be sure to install the Devtool before doing anything**, everything will work fine, no matter if you restart the IDE or restart the PC.

I just did a reinstallation to the Flutter but failed to reproduce the issue, the good thing is that while the Devtool is already get installed (I forgot to clean the .pub-cache folder), the debug process started successfully without any problems, which means the issue is gone.

so, to fix the issue, try killing all the pub processes and setting up the proxy if necessary, then you are ready to go only after you have installed the Devtools somewhere else (or waiting for it to be finished).
